  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'index-import',
	title: 'Import Data into Redis',
	sidebar_label: 'Importing Data',
	slug: '/guides/import/'
};
export const metadata = {
  "unversionedId": "guides/import/index-import",
  "id": "guides/import/index-import",
  "isDocsHomePage": false,
  "title": "Import Data into Redis",
  "description": "Import using reds-cli script",
  "source": "@site/docs/guides/import/index-import.mdx",
  "slug": "/guides/import/",
  "permalink": "/guides/import/",
  "editUrl": "https://github.com/redis-developer/redis-developer/edit/master/docs/guides/import/index-import.mdx",
  "version": "current",
  "sidebar_label": "Importing Data"
};
  /* @jsxRuntime classic */
/* @jsx mdx */
import RedisCard from '@site/src/theme/RedisCard';
export const toc = [{
  value: 'Import using <code>reds-cli</code> script',
  id: 'import-using-reds-cli-script',
  children: []
}, {
  value: 'Restore an RDB file',
  id: 'restore-an-rdb-file',
  children: []
}, {
  value: 'Import &amp; Synchronize using RIOT',
  id: 'import--synchronize-using-riot',
  children: []
}, {
  value: 'Import data into Redis Enterprise',
  id: 'import-data-into-redis-enterprise',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`Redis offers multiple ways to import data into a database; from an file, an script or from an existing Redis database.`}</p>
    <h2 {...{
      "id": "import-using-reds-cli-script"
    }}>{`Import using `}<inlineCode parentName="h2">{`reds-cli`}</inlineCode>{` script`}</h2>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`Create a simple file `}<inlineCode parentName="p">{`users.redis`}</inlineCode>{` with all the commands you want to run`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{`HSET 'user:001' first_name 'John' last_name 'doe' dob '12-JUN-1970'
HSET 'user:002' first_name 'David' last_name 'Bloom' dob '03-MAR-1981'
`}</code></pre>
      </li>
      <li parentName="ol">
        <p parentName="li">{`Use the `}<inlineCode parentName="p">{`redis-cli`}</inlineCode>{` tool to execute the script`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{`redis-cli -h localhost -p 6379 < users.redis
`}</code></pre>
      </li>
    </ol>
    <p><em parentName="p">{`This approach will only run the commands and will not impact the existing data, except if you modify existing keys in the script.`}</em></p>
    <blockquote>
      <p parentName="blockquote">{`Sample dataset: You can find sample dataset ready to be imported using this method in the `}<a parentName="p" {...{
          "href": "https://github.com/redis-developer/redis-datasets"
        }}><inlineCode parentName="a">{`https://github.com/redis-developer/redis-datasets`}</inlineCode></a>{` repository.`}</p>
    </blockquote>
    <hr></hr>
    <h2 {...{
      "id": "restore-an-rdb-file"
    }}>{`Restore an RDB file`}</h2>
    <p>{`If you have an RDB file `}<inlineCode parentName="p">{`dump.rdb`}</inlineCode>{` that contains the data you want you can use this file to create a new database`}</p>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`Copy the `}<inlineCode parentName="p">{`dump.rdb`}</inlineCode>{` file into the Redis working directory `}</p>
        <p parentName="li">{`If you do not know what it is folder you can run the command `}<a parentName="p" {...{
            "href": "https://redis.io/commands/config-get"
          }}><inlineCode parentName="a">{`CONFIG get dir`}</inlineCode></a>{` where your Redis instance is up and running`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`Start the Redis service with the `}<inlineCode parentName="p">{`redis-server`}</inlineCode></p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`The file `}<inlineCode parentName="p">{`dump.rdb`}</inlineCode>{` is automatically imported.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`Connect to the database using `}<inlineCode parentName="p">{`redis-cli`}</inlineCode>{` or any other client, to check that data have been imported. (for example `}<a parentName="p" {...{
            "href": "https://redis.io/commands/SCAN"
          }}><inlineCode parentName="a">{`SCAN`}</inlineCode></a>{`)`}</p>
      </li>
    </ol>
    <h4 {...{
      "id": "related-articles"
    }}>{`Related Articles`}</h4>
    <div class="row">
      <div class="col">
        <RedisCard title="Redis Persistence" page="https://redis.io/topics/persistence" mdxType="RedisCard" />
      </div>
      <div class="col">
      </div>
    </div>
    <p><em parentName="p">{`- `}<strong parentName="em">{`Warning`}</strong>{`: Importing data erases all existing content in the database.`}</em></p>
    <hr></hr>
    <h2 {...{
      "id": "import--synchronize-using-riot"
    }}>{`Import & Synchronize using RIOT`}</h2>
    <p><a parentName="p" {...{
        "href": "https://github.com/redis-developer/riot"
      }}>{`Redis Input/Output Tools (RIOT)`}</a>{` is a set of import/export command line utilities for Redis:`}</p>
    <ul>
      <li parentName="ul">{`RIOT DB: migrate from an RDBMS to Redis, RediSearch, RedisJSON, ...`}</li>
      <li parentName="ul">{`RIOT File: bulk import/export data from/to files.`}</li>
      <li parentName="ul">{`RIOT Gen: generate sample Redis datasets for new feature development and proof of concept.`}</li>
      <li parentName="ul">{`RIOT Redis: live replication from any Redis database (including AWS Elasticache) to another Redis database.`}</li>
      <li parentName="ul">{`RIOT Stream: import/export messages from/to Kafka topics.`}</li>
    </ul>
    <h4 {...{
      "id": "related-articles-1"
    }}>{`Related Articles`}</h4>
    <div class="row">
      <div class="col">
        <RedisCard title="Online Database Migration from Amazon ElastiCache to Redis Enterprise Cloud using RIOT" page="/guides/import/database-migration-aws-elasticache-redis-enterprise-cloud" mdxType="RedisCard" />
      </div>
    </div>
    <hr></hr>
    <h2 {...{
      "id": "import-data-into-redis-enterprise"
    }}>{`Import data into Redis Enterprise`}</h2>
    <p>{`You can easily import data into Redis Enterprise and Redis Enterprise Cloud, take a look to the following documentation:`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://docs.redislabs.com/latest/rs/administering/import-export/importing-data/"
        }}>{`Redis Enterprise Software: Importing Data into a Database`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://docs.redislabs.com/latest/rc/api/how-to/backup-and-import-databases/"
        }}>{`Redis Enterprise Cloud: Databases Backup and Import`}</a></li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
